INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118061, "青空の下で謁見", 40, 1, 2, 2834, 8, 91002, 7, 10118, "ペコリーヌとの出会い", "フリーマーケット会場", 20063115, 0, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118062, "未来の騎空団\nマスコット？", 40, 1, 2, 2835, 8, 91002, 7, 10118, "マホとの出会い", "フリーマーケット会場", 20063115, 0, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118063, "お嬢さまからの\n緊急依頼", 40, 1, 2, 2837, 8, 91002, 7, 10118, "アキノとの出会い", "ランドソル市街地", 20063115, 0, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118064, "黄金色の悩みごと", 40, 1, 2, 4108402, 8, 91002, 18, 10118, "ジュンとの出会い", "フリーマーケット会場", 20063115, 0, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118065, "白熱！　格闘大会！", 40, 1, 2, 4107402, 8, 91002, 18, 10118, "カオリとの出会い", "フリーマーケット会場", 20063115, 0, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118066, "祭り太鼓はオーエドの華", 40, 1, 2, 9000227, 8, 91002, 16, 10118, "ニノンとの出会い", "オーエド町", 20063115, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118067, "人気者は遅れて\nやってくる", 40, 1, 3, 2101181, 8, 91002, 19, 10118, "スズナとの出会い", "フリーマーケット会場", 20063115, 0, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118068, "巫女・ミーツ・魔法少女", 40, 1, 3, 4109402, 8, 91002, 18, 10118, "ナナカとの出会い", "ランドソル市街地", 20063115, 0, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118069, "ネズ耳は二度なくなる", 40, 1, 3, 4305402, 8, 91002, 18, 10118, "キャル＆コッコロとの出会い", "フリーマーケット会場", 20063115, 0, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118070, "この出会いにカンパイ！", 40, 1, 3, 4101402, 8, 91002, 18, 10118, "ユカリとの出会い", "ランドソル市街地", 20063115, 0, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118071, "陰陽アンサンブル", 40, 1, 3, 4106402, 8, 91002, 18, 10118, "アオイとの出会い", "ランドソル市街地", 20063115, 0, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118072, "運試し十番勝負！", 40, 1, 3, 2836, 8, 91002, 7, 10118, "シノブとの出会い", "フリーマーケット会場", 20063115, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。");
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (5118600, "彼女たちの新たな日常", 0, 0, 1, 0, 0, 0, 0, 10118, "オープニング", 0, 20063115, 0, 0);
